import "./LogInStyle.css";
import "../components/GrowItem.scss";
import { useContext } from "react";
import AuthContext from "../context/authContext";
const FaconConnect = () => {
  const auth = useContext(AuthContext);
  return (
    <div>
      <header>
        <table className="nav">
          <tr>
            <th>
              {" "}
              <img alt="" className="logo" src="images/oyemkemlavert.png" />
            </th>
          </tr>
        </table>
      </header>

      <section className="main">
        <p className="sign">Se Connecter En Tant Que :</p>

        <table>
          <tr>
            <th>
              <img alt="" className="image" src="images/oyemvertblanc.jpg" />
            </th>
            <th>
              <form className="form1" />
              if( {auth.EmployeeId.type} ==="Administrateur")
              {
                <div class="screen">
                  <div class="mainn growCard">
                    <p class="typeUser">Administrateur</p>
                  </div>
                  <div class="mainn growCard">
                    <p class="typeUser">Superviseur</p>
                  </div>
                  <div class="mainn growCard">
                    <p class="typeUser">Coach</p>
                  </div>
                </div>
              }
              else if({auth.EmployeeId.type} ==="Superviseur")
              {
                <div class="screen">
                  <div class="mainn growCard">
                    <p class="typeUser">Superviseur</p>
                  </div>
                  <div class="mainn growCard">
                    <p class="typeUser">Coach</p>
                  </div>
                </div>
              }
              else({auth.EmployeeId.type} ==="Coach")
              {
                <div class="screen">
                  <div class="mainn growCard">
                    <p class="typeUser">Coach</p>
                  </div>
                </div>
              }
              <br />
              <div></div>
            </th>
          </tr>
        </table>
      </section>
    </div>
  );
};
export default FaconConnect;
